import React from 'react';
import Product from '../Components/Product.json';

function ProductBody() {
    return (
        <div>
            {Product.map((productInfo, index) => {
                return (
                    <div>
                        <img>{productInfo.img}</img>
                    </div>
                )
            })}
        </div>
    )
}

export default ProductBody;
